import React from 'react';

const About = () => {
  return (
    <section id="about" className="py-16 bg-gray-50 px-6">
      <h2 className="text-3xl font-semibold text-center mb-6">About Finlytiq LLP</h2>
      <p className="max-w-4xl mx-auto text-center text-gray-700">
        Finlytiq LLP is a team of experienced finance professionals helping startups and SMEs grow smartly. Our approach blends deep financial insight, automation, and strategic planning.
      </p>
    </section>
  );
};

export default About;
